offers.description:
Автомобиль в хорошем состоянии для своих лет! В серьезных дтп не учавствовал, только небольшие жизненные царапины или сколы (на фото видно). 

По комплектации: 

- Раздельный климат контроль; 
- Регулировка водительского сиденья в двух положениях; 
- Парктроники; 
- Обогрев передних сидений; 
- Зимний стеклопакет; 
- Электропривод зеркал; 
- Зеркало заднего вида с затемнением; 

Стоят новые свечи. Новый аккумулятор (месяц всего откатал на нем). Автомобилем владею 2.5 года, все необходимые замены по ТО проводились вовремя. Печка, кондиционер работают на ура (перед летом менял ремень кондера и фрион) 
По ходовке посторонних звуков нет, все в порядке. 

Каких- то вложений не требует, ездил каждый день на работу. 

В комплекте почти новая зимняя резина (1.5 сезона отъездил на ней). 

Реальному покупателю торг!
